import React, { Component } from 'react';
import { Carousel } from 'react-responsive-carousel';
import Play from '../Components/Play';

import A_discoveredPlantText from '../img/carousel-img/A_discoveredPlantText.jpg';
import B_coney from '../img/carousel-img/B_coney.jpg';
import C_cincinnatioh from '../img/carousel-img/C_cincinnati-oh.jpg';
import D_fountainSquare from '../img/carousel-img/D_fountainSquare.jpg';
import E_exploreCreationnMuseum from '../img/carousel-img/E_exploreCreationMuseum';
import E_Skywheel  from '../img/carousel-img/E_Skywheel .jpg';
import F_ShopKwmall from '../img/carousel-img/F_ShopKwmall.jpg';
import G_bigcincy from '../img/carousel-img/G_bigcincy .jpg';
import H_eatAbigailStreet from '../img/carousel-img/H_eatAbigailStreet.png';
import I_Eden2 from '../img/carousel-img/I_Eden2.jpg';
import J_Lion from '../img/carousel-img/J_Lion.jpg';
import K_Skydiving from '../img/carousel-img/K_Skydiving.jpg';


import AOS from 'aos';
import 'aos/dist/aos.css';

class CarouselNew extends Component {
    componentDidMount() {
        // or simply just AOS.init();
        AOS.init({
          // initialise with other settings
          duration : 3000
        });
      }

    render() {
        return (
            
          <div>
          <Carousel data-aos="fade-right">

            <div>
                <img alt='image' src= { A_discoveredPlantText } />
                <p className="legend"></p>
            </div>

            <div>
                <img alt='image' src= { C_cincinntioh } />
                <p className="legend"></p>
            </div>

            <div>
                <img alt='image' src= { D_fountainSquare } />
                <p className="legend"></p>
            </div>

            <div>
                <img alt='image' src= { E_exploreCreationnMuseum } />
                <p className="legend"></p>
            </div>

            <div>
                <img alt='image' src= { E_Skywheel } />
                <p className="legend"></p>
            </div>

            <div>
                <img alt='image' src= { F_ShopKwmall } />
                <p className="legend"></p>
            </div>

            <div>
                <img alt='image' src= { G_bigcincy } />
                <p className="legend"></p>
            </div>

            <div>
                <img alt='image' src= { H_eatAbigailStreet } />
                <p className="legend"></p>
            </div>

            <div>
                <img alt='image' src= { I_Eden2 } />
                <p className="legend"></p>
            </div>

            <div>
                <img alt='image' src= { J_Lion } />
                <p className="legend"></p>
            </div>

            <div>
                <img alt='image' src= { K_Skydiving } />
                <p className="legend"></p>
            </div>

            <div>
                <img alt='image' src= { B_coney } />
                <p className="legend"></p>
            </div>

        
           
             </Carousel>
                 <div data-aos="fade-right"><Play /></div>
        </div>    
        );
    }
}
export default CarouselNew
